import pandas as pdimport numpy as npimport matplotlib.pyplot as pltimport seaborn as snsdf = pd.read_csv('~/Desktop/capstone/speeddating.csv')file_path = 'SpeedDatingData.csv'try:    df2 = pd.read_csv(file_path, encoding='utf-8') except:    pass# Let's start by changing the empty spaces by nan values to have a clear image# of the datasetdf.replace('?' ,np.nan, inplace=True)df.info(verbose=True)def convert_to_numeric(obj):    """    Convert object to an int, or float, or returns the object (string)    if neither is possible.    """    try:        # Attempt to convert directly to int, then float if ValueError is raised        return int(obj)    except ValueError:        try:            return float(obj)        except ValueError:            return obj        df = df.applymap(convert_to_numeric)columns_df1 = set(df.columns)columns_df2 = set(df2.columns)# Find common columnscommon_columns = columns_df1.intersection(columns_df2)# Find columns unique to df1unique_to_df1 = columns_df1.difference(columns_df2)# Find columns unique to df2unique_to_df2 = columns_df2.difference(columns_df1)